(16, 'By John Russell\nImagine a beach; a quiet place, with only the noise of the sea and the gulls in the background. There are boats floating near the shore and a few people swimming in the water next to them. It?s a hot day, and there are some people lying on the sand enjoying the sunshine and slowly going brown. There are no shops, no people making noises, no loud music, everything is peaceful. There is just the sea, the sun, and the beach; a little paradise.\n\nWhere is it?\n\nThe beach is on the south coast of Scotland, near a little town called Gatehouse of Fleet in the county of Dumfries and Galloway. 22 years ago my family and I found this place for the first time and we have never really left it. Every year in the summer while other people go on holiday to foreign countries and exotic places, we go to our private paradise and relax. There is a little campsite with tents and caravans next to the beach, and this becomes our home for one month every year.\n\nGrowing up\n\nFor a child a beach is a wonderful place. Here I found lots of space to run and play on the sand or to swim in the water. Being a campsite there were always lots of other families with children to play with. Another of my favourite activities was climbing on the rocks and cliffs around the beach. Rock pools were very educational places where I used to study the little fish and sea animals. Silence was also important; at school I was always surrounded by people and noise but the beach gave me the chance to be on my own and think, or read, away from anyone else.\n\nStorms\n\nAlthough the sea can be beautiful, this beach is sometimes a dangerous place to be. When the weather is bad there are often storms with strong winds. When this happens the waves can get up to 2-3 metres high ? definitely not weather for swimming. Every year some of the boats anchored on the beach are lost because the sea is so rough. I remember holding down our tent to stop the wind blowing it away on many occasions! However, if the waves weren?t too high all the children (and some adults) used to go swimming in life jackets, as it was very exciting.\n\nAn interesting hobby\n\nSailing is a very serious activity in the UK, and this beach is no different. There are large racing boats for three or more people, smaller boats (such as the Topper) for just one or two people, fishing boats and windsurfers. In fact people on this beach are willing to try any type of water-sport; water skiing, speed boating, even the recent sport of sail surfing is becoming popular. Over the years my family has had 4 different boats, from a small Topper to a large Caprice for racing. We have sailed, raced, and fished off the boats, and have even capsized in bad weather a few times.\n\nSurroundings\n\nIf this beach had been next to a town or near a popular tourist area I don?t think we would have continued going there. But its location is very beautiful indeed. It?s in the middle of green countryside with many different types of plants and flowers, and in the background the hills of Galloway can be seen. Lots of photographers and artists come to the area (also known as the Solway) because they can capture such beautiful scenery.\n\nA refuge\n\nEven after 22 years, the beach is still a sanctuary for me. It?s a place away from the rest of the world where I can forget about life?s problems, and just relax. In today?s modern, busy world, everyone should have a place like this.', '2017-08-08'),
(17, 'Whenever sang my songs,\nOn the stage, on my own,\nWhenever said my words,\nWishing they would be heard,\nI saw you smiling at me,\nWas it real, or just my fantasy?,\nYou\'d always be there in the corner,\nOf this tiny little bar,\n\nMy last night here for you,\nSame old songs, just once more,\nMy last night here with you?,\nMaybe yes, maybe no,\nI kind of liked it your way,\nHow you shyly placed your eyes on me,\nDid you ever know,\nThat I had mine on you?,\n\nDarling, so there you are,\nWith that look on your face,\nAs if you\'re never hurt,\nAs if you\'re never down,\nShall I be the one for you,\nWho pinches you softly but sure?,\nIf frown is shown, then,\nI will know that you are no dreamer,\n\nSo let me come to you,\nClose as I want to be,\nClose enough for me,\nTo feel your heart beating fast,\nAnd stay there as I whisper,\nHow I love your peaceful eyes on me,\nDid you ever know,\nThat I had mine on you?,\n\nDarling, so share with me,\nYour love if you have enough,\nYour tears if you\'re holding back,\nOr pain if that\'s what it is,\nHow can I let you know,\nI\'m more than the dress and the voice,\nJust reach me out, then,\nYou will know that you are not dreaming,\n\nDarling, so there you are,\nWith that look on your face,\nAs if you\'re never hurt,\nAs if you\'re never down,\nShall I be the one for you,\nWho pinches you softly but sure?,\nIf frown is shown, then,\nI will know that you are no dreamer.', '2017-08-01'),
(19, 'North Richmond Street, being blind, was a quiet street except at the hour when the Christian Brothers\' School set the boys free. An uninhabited house of two storeys stood at the blind end, detached from its neighbours in a square ground. The other houses of the street, conscious of decent lives within them, gazed at one another with brown imperturbable faces.The former tenant of our house, a priest, had died in the back drawing-room. Air, musty from having been long enclosed, hung in all the rooms, and the waste room behind the kitchen was littered with old useless papers. Among these I found a few paper-covered books, the pages of which were curled and damp: The Abbot, by Walter Scott, The Devout Communicant, and The Memoirs of Vidocq. I liked the last best because its leaves were yellow. The wild garden behind the house contained a central apple-tree and a few straggling bushes, under one of which I found the late tenant\'s rusty bicycle-pump. He had been a very charitable priest; in his will he had left all his money to institutions and the furniture of his house to his sister.When the short days of winter came, dusk fell before we had well eaten our dinners. When we met in the street the houses had grown sombre. The space of sky above us was the colour of ever-changing violet and towards it the lamps of the street lifted their feeble lanterns. The cold air stung us and we played till our bodies glowed. Our shouts echoed in the silent street. The career of our play brought us through the dark muddy lanes behind the houses, where we ran the gauntlet of the rough tribes from the cottages, to the back doors of the dark dripping gardens where odours arose from the ashpits, to the dark odorous stables where a coachman smoothed and combed the horse or shook music from the buckled harness. When we returned to the street, light from the kitchen windows had filled the areas. If my uncle was seen turning the corner, we hid in the shadow until we had seen him safely housed. Or if Mangan\'s sister came out on the doorstep to call her brother in to his tea, we watched her from our shadow peer up and down the street. We waited to see whether she would remain or go in and, if she remained, we left our shadow and walked up to Mangan\'s steps resignedly. She was waiting for us, her figure defined by the light from the half-opened door. Her brother always teased her before he obeyed, and I stood by the railings looking at her. Her dress swung as she moved her body, and the soft rope of her hair tossed from side to side.Every morning I lay on the floor in the front parlour watching her door. The blind was pulled down to within an inch of the sash so that I could not be seen. When she came out on the doorstep my heart leaped. I ran to the hall, seized my books and followed her. I kept her brown figure always in my eye and, when we came near the point at which our ways diverged, I quickened my pace and passed her. This happened morning after morning. I had never spoken to her, except for a few casual words, and yet her name was like a summons to all my foolish blood.Her image accompanied me even in places the most hostile to romance. On Saturday evenings when my aunt went marketing I had to go to carry some of the parcels. We walked through the flaring streets, jostled by drunken men and bargaining women, amid the curses of labourers, the shrill litanies of shop-boys who stood on guard by the barrels of pigs\' cheeks, the nasal chanting of street-singers, who sang a come-all-you about O\'Donovan Rossa, or a ballad about the troubles in our native land. These noises converged in a single sensation of life for me: I imagined that I bore my chalice safely through a throng of foes. Her name sprang to my lips at moments in strange prayers and praises which I myself did not understand. My eyes were often full of tears (I could not tell why) and at times a flood from my heart seemed to pour itself out into my bosom. I thought little of the future. I did not know whether I would ever speak to her or not or, if I spoke to her, how I could tell her of my confused adoration. But my body was like a harp and her words and gestures were like fingers running upon the wires.', '2017-08-09'),
(20, 'What is your current English level and how did you learn it? Have you ever traveled to any English speaking country or lived there? How well can you understand people? What are your strengths and weaknesses?: My current english level according to the CEFR is B1, The basic and technical that I have learned has been in school and in my career as a lover of information technology. I am currently studying English very carefully, reading articles in English (Cnn, BBC, Nytimes), watching series in English, and learning each day More, because my motivation is to internationalize my talent and share my skills.i have not traveled to any english speaking country yet, i have a good reading and writing skills however my listening skills have to be improved, i understand what people say but i am  not used to do it.', '2017-08-01'),
(21, 'How do you feel you compare to the items on the job description? Please list one by one and explain your experience with each. If you don\'t have experience with something, let us know what similar technology you have worked with, or what your basic understanding is of the thing you haven\'t worked with.: \n\nSeeing the job offer, I feel able to meet your expectations, I feel identified with what you seek.\n\nMinimum four (4) years of Java coding experience: I have been working with Java technologies for about 7 years, including java 2 Standard Edition, java Enterprise Edition (JSP, JSF, EJB, JPA) With these technologies, I have made new developments, new features to be required, and fixing errors.\n\nMinimum three years of Eclipse development experience: i have been working with Eclipse Development 5 years, and with netbeans 4 years.\nWith these development tools such as netbeans and eclipse, I have learned to find functionalities that for us developers are very useful, for example to add a new server, connect to a database, add a new plugin, etc, I have shared those knowledge with my colleagues.\n\nMinimum three years developing client-side front-ends: i have been working with client-side front-ends 5 years. I have worked on making new user interface components, so they are reusable, and streamline the development, applying mvc concepts and internationalization.\n\nExperience developing Eclipse plug-ins and SWT front-ends a plus: i have not worked with swt, but i have worked with previous technologies such as awt, swing, gwt, jsf (primefaces, richfaces).\nWith these technologies, I have made new developments, new features to be required, and fixing errors.\n', '2017-08-01'),
(22, 'Explain how you have used Eclipse in the past: When starting my career as a programmer I needed a powerful tool that did not consume so many resources, and I realized that eclipse was my best choice, the beginning was difficult, but over the years I have learned many of its features.\n\nYear 2011: I learned how to use eclipse, create new projects, create awt and swing interfaces, compile, basic functions, it was a hard start, but it was about learning.\n\nYear 2012 - 2013: I learned to use eclipse for web development, with different technologies, such as spring, struts, jsf, hibernate, ejb. I learned how to connect eclipse to the database, add a new server, learned how to debug, log configuration, access and customize settings and add new plugins\n\nYear 2014 - 2016: In this time, I have shared my knowledge with junior programmers, and senior in java, if someone needs to make a configuration I helped him.\n\nThroughout this year I have developed several versions of eclipse, eclipse juno, galileo eclipse, eclipse mars, spring tool suits, groovy tool suits that are custom versions of eclipse.\n', '2017-08-02'),
(23, 'Please explain what a component model (plugins) is and how you have used it in the past.: \nI have installed new plugins in eclipse to add new features,\n\nTortoise svn plugins: to link a project to svn or download it, manage versioning, and make splices in the developments.\n\nMaven plugin: to be able to create, configure and download dependencies of repositories, besides being able to compile and package deliverables.\n\nOracle WebLogic Server Tools | Eclipse Plugins: to add special eclipse features to oracle proxies as weblogic.\n\nToad Extension for Eclipse | Eclipse Plugins: a very useful plugin for handling databases from eclipse.\n\nJBoss Tools: a very useful plugin for good functionality for programmers when using jboss products.\n', '2017-08-02'),
(24, 'Explain what you know about Eclipse plug-ins.: Eclipse plug-ins are very useful features that can be customized according to the need of the programmer, the idea of the Eclipse plug-ins is to facilitate to a certain extent the routine settings that must be made in a software project. There are currently many Eclipse plug-ins for either client-side user interfaces, web forms, database, servers, etc., we can create Eclipse plug-ins, I have not created an Eclipse plug-in but I know it can and it is one good tool.', '2017-08-02'),
(25, 'Describe a complex system you\'ve built using components or modules, ideally one that includes formal & defined interdependencies (be specific about the architecture, and role you had):\nIn the project Migration Colombia, I was the role of Java programmer, was a team work, was a part of the system that did not have a fixed finality, and should be dynamic, said functionality should allow itself to be created. Create yourself?, yes, a user interface that had two modes, one was administrator mode, and the second was agent mode.\n\nThis functionality allowed the administrator to spell out what should be the search form that the agent should operate.\n\nThe administrator mode allows you to specify which user interface fields should appear in the agent mode, either one or more single selection lists or multiple selection, text boxes, date fields, number fields. Additionally, to each list and to each selection table had its own result.\n\nThe administrator mode only had to enter the following fields:\n\nField 1: field type (composed of text, single selection list, multiple selection list, tables, field date, field number, field text).\n\n* (If the administrator selected some list field then field 2 will appear)\nField 2: In this will be entered an sql, which will return the result to be displayed in: tables, single / multiple selection lists.\n\nThe agent mode saw the result of the configuration made in the search window, and could do the search with the resources (fields created by the administrator) that had in front. And display the result.\n', '2017-08-02'),
(26, 'What was the biggest miss you\'ve had in architecting a system and how did you recover (provide specifics)?\nThe biggest fault has been tread the changes or codes to a partner, while we synchronized the same file.\n\nIn the project of the Ministry of National Education, which was a large project and many people, we synchronized the codes daily, but there came a time where several people had to synchronize the same file.\n\nSomeone formatted the java class and messed up the code. i did not see the differences well in the code, and i added the code, and change uploaded. in that moment, a partner raised the voice, their code had missing, we reviewed and effectively i had treaded their Changes, we revise the code, we added what missing and ready.\n\nServed us experience when working with versions, first update our codes, and then add our codes, and not tread the codes!\n', '2017-08-02'),
(27, 'What are characteristics of a good user interface and do you view yourself as a \"UI guru\"?\nSimplicity, do not complicate doing user interfaces, currently users prefer simple forms, which are not complicated, are clear with aids when filling a field, if a field is restricted to enter number or signs, then specialize very well with messages and examples of how to fill the field.\n\nI as a user also fill out forms and learn from the sophisticated, I consider myself UI \n', '2017-08-03'),
(28, 'Where do you see the intersection of Java in the Enterprise with other technologies including Angular, Node and Hybrid Mobile?\nI have studied Angular as javascript framework, once I read from Node and Hybrid Mobile, these very powerful tools to enrich the user interface are more powerful with the help of a robust ally as it is java, these applications can communicate with java enterprise Via web services or json, spring framwork.\n', '2017-08-03'),
(29, 'What is the role of a plug-in in an IDE, and describe experiences you\'ve had in developing one -- if no experience, describe an activity you\'ve done that you believe equivalent:\n\nI have not had the opportunity to create a plug-in in some IDE, but I have done similar functions in java, for example there are wizards that allow to generate classes or repetitive codes, that\'s where I come from. I have created java wizards that generate the CRUD of a project, or I only generate user interfaces, or just thick classes, and my task is to copy and paste, the wizards make life easier for programmers, I hope robots do not Read this idea.\n', '2017-08-03'),
(30, 'In your current role, distributing 10 points across these areas, how would you allocate your time spent on: a. Coding, b. Mentoring, c. Designing, d. Learning, e. other (describe):\n\n\nCurrently in my development I distribute in several points my assignment, and are composed of the following:\n\n1) Assignment of task: to have clear the assignment that has been made to me\n2) Reading the assignment: reading the assignment, or activity.\n3) Design in a flow the process to realize: to design to have more clear the process that is going to develop.\n4) Taking note of the clear themes: take notes of the clear themes\n5) Taking notes of doubts and issues that are not yet clear: if you do not have doubts, go to step 7, and your question arises, come back to this point.\n6) Clarify the doubts: expose the doubts you have, send mail, or by chat, when clearing the doubt go to step 7\n\n7) Codification: write codes and algorithms that allow an efficiency in the processes, and applying good practices.\n8) Search for resources on the internet support and documentation: clarify doubts by reviewing documentation for good development practices.\n9) Autonomous learning: reviewing documentation.\n10) Have the resources on hand for next developments: continuous learning, and resources for future developments, and reuse, in addition to sharing knowledge with the team.\n', '2017-08-03'),
(31, 'In your ideal role, distributing 10 points across these areas, how would you prefer to allocate your time spent on: a. Coding, b. Mentoring, c. Designing, d. Learning, e. Other (describe), please explain differences with #15:\n\nCoding\n-Notes of the topics that have or are not clear\n-Reproduction of code.\n-Review documentation for support and help.\nMentoring\n-Review of documentation and keep reference.\n- search help in forums\nDesigning\n-Designing a workflow to be performed\n- data design if they do not exist\nLearning\n-Read the documentation continuously.\nOther\n-to share knowledge with peers.\n-create a wiki to store reusable code.\n', '2017-08-03'),
(32, 'Would you consider yourself a Full Stack developer (explain your rationale regardless of positive / negative response)?\nThrough these years I have been developing front end and back end. One sees in the need to learn technologies that make a development look beautiful, I consider Full Stack developer, because it is necessary to be it in the industry where there is always something to do and you have to be prepared. Thanks to a lot of documentation you can achieve it. make a pretty interface until to make a list contains results based on a logic.\n', '2017-08-04'),
(33, 'What is the most complex client-side user interface you\'ve built and was was your role on the team? Do you have experience with SWT?\nMy grade project was a project that consisted of a musical Piano, which had several octaves, you could write a melody with its times equivalent to square brackets, black, round, until reproduced. To develop it do not use graphical wizard, everything was based on code and coordinates to sort the buttons.\n\nI have no experience in SWT, but I learned and worked with AWT and Swing. Create an application with Swing, an application where users could consult spare parts for cars, see images, etc., use Swing, Hibernate, and SQLite, since the application was portable.\n', '2017-08-04'),
(34, 'What is the shortest amount of time you have stayed in a position in the past, and why?\n\n\n2 and a half months, and it was because the project was in its final phase.\n\nI perform very well in that work, stay in touch with my boss and currently he recommends me, and advises me.\n', '2017-08-04'),
(35, 'What are your career goals for the next 2 years? Why are you looking to change positions / consider a position with us?\nI will be a bilingual engineer and I will have an English level of C1, since my goal currently is to learn more English, and speak fluently. besides studying software architecture, I do not see myself in Colombia, I see myself working in the United States, and traveling to many places, because one of my goals from the beginning has been to travel the world.\n', '2017-08-04'),
(36, 'Software Developer with more than 5 years of experience in Java and Oracle technology, I have worked in several companies where I have learned and developed my skills in development, implementation, migration, bug fixes, I have participated in projects ranging from small to large scale Such as the projects for the Ministry of National Education, Migration Colombia, and CSI Group participate in the IAXIS software project used by companies such as Liberty Seguros and Confianza among other insurers. Passionate about continuous learning and teamwork.', '2017-08-04'),
(37, 'SALUDCOOP, Health care company in charge of payments management for the IPS, in this entity I worked as a system typist, as well as an assistant of the Occupational Health Physician, where I managed the database of patients who would be close to being pensioned, In addition request to the patients the documentation required to be transferred to the corresponding ARPs.', '2017-08-05'),
(38, 'Datasysworld, New company in the city of barranquilla which gave computer solutions to entities that required an application to manage their system.\nProteger Consultora, Occupational Health Clinic, In this project participate in the lifting of requirements of the modules of People, Audiometry, Optometry, Spirometry. This system had the functionality of administering from the patient\'s entry, registration of appointments until passing by each of the professionals for which the patient should be attended. \n', '2017-08-05'),
(39, 'America System, an English language school that is based in different cities of Colombia and allows the English language learning to children, adolescents and young people. In this project the main objective was initially to migrate the functionality of an application made in Java Applet of which We did not have the source code and migrate it to a Web application, this goal was successfully achieved, then created new functionalities required by the client as time went by, the system is in its operation allowing teachers to enter and Schedule their courses, and students enter and schedule their schedules and different academic activities.', '2017-08-05'),
(40, 'Grift company software project which distributes auto parts for vehicles, the functionality of this system was to allow users to check the auto parts they wanted to buy, the software allows them to perform such consultation filtering by vehicle brand and models. This application was worked together with the graphic designer which provided the images of the system.', '2017-08-05'),
(41, 'Righthand, New company in the city of Barranquilla whose goal was to provide solutions with implementation of software to the measure.\n\nSaintec, In this project I had the opportunity to be part of a team where we developed new functionalities for the Saintec Dental Clinic in the city of Barranquilla, we used Google technology for graphic interface as it provided security and robustness.\n', '2017-08-05'),
(42, 'I2B Tecnologies, a Chilean company based in barranquilla, in this company I had the opportunity to work for the project Walmart in Chile, where I was part of a large team of developers Backend and Frontend, in addition to competing my knowledge to the fellows of others Projects.\n\nWalmart Chile, In this project, the Walmart Chile system was supported under the Oracle ATG Commerce system for Walmart Chile (leader.cl). In this project, new functionalities were created and support was given to existing functionalities. Designs.\n', '2017-08-06'),
(43, 'LomincoSoft was the company that gave me the opportunity to come to the city of Bogota, where I was able to expand my knowledge and make myself known in the software development industry. In this company Outsourcing for the company Innovar Technology I had the opportunity to work on two projects, Ministry of National Education and Migration Colombia. \n \nMinistry of National Education, In LomincoSoft outsourcing for Innovar Tecnologas was where I started in the project of Nuevos Saces for the state entity Ministry of National Education, after having participated in the project Migration Colombia, the leaders liked my performance and continued with them working together with The project architect for the selection of technologies for the ongoing project and revision of documents for the development of Mockups and later the beginning of the developments.\n\nThe main functionalities of the system were developed, which would be the bases for the construction of the other modules.\n\nMigration Colombia, Migration Colombia, a state entity that legally regulates everything that enters and leaves the country, I had the opportunity to work in this development team extending the functionality of the existing system, as well as creating new functionalities that were generic, reusable and dynamic to the client.\nIn this project I also supported the development team by sharing my knowledge and teaching the operation of the technologies that were being used for better use and better performance.\n', '2017-08-06'),
(44, 'INNOVAR TECNOLOGIA SAS, Innovate Technologies software development company where I had the opportunity to be part of several development teams and in different projects, I worked with many engineers of whom I had the opportunity to learn from them and them from me, something we had very present was to share Knowledge as we were working and developing the different projects in which we were performing.\n\nMinistry of National Education, In the project New Saces for the Ministry of National Education I had the opportunity to start from the beginning, in the first meetings where they delivered the functional and non-functional documents, in the first meetings with the client where the doubts were clarified and I took notes of the suggestions from the client. In addition, we did an analysis of the case design of uses, initially developed designs of screens where they could be visualized by means of images very briefly the operation of the system.\nI was part of the team along with the project Architect in the study and selection of technologies to use for the project, research pro and cons of each of the tools.\nThey began the development of the cases of uses and creation of the tables of the database, where reusable components were created and avoiding the redundancy of code.\nIn this project I did part of the migration of data from Postgres to Oracle and normalization of data and so these will remain in the new structure of the database.\nI was part of the delivery of the final project and data migrated to the Ministry of National Education where we were able to complete this project under the requirements that had been established.\n\nRodrigo Lara Bonilla School, When entering the project of the School Rodrigo Lara Bonilla this already was in the 70% of development. In this project I was able to participate in new functionalities that had been requested by the client, this project had a series of reports which were delivered in its entirety. In this project I participate in the migration of data from CSV files to Postgrest, for the migration of data develop an application in Java which read the flat files and depending on rules established by the client each record was to be migrated to the new structure Of tables, a record that did not comply with the business rules was stored in a final file and then sent to review.\nThe project was culminated in its totality for its launch in the ceremonial events of the School Rodrigo Lara Bonilla.\n', '2017-08-06'),
(45, 'CSI GROUP, In this company, I work as a Java developer on the IAxis and Ithaca projects, large software projects that are responsible for maintenance and insurance processes. Large companies in the area of insurance like Liberty, Confianza, Positiva among others of the market. In Csi we had the motto of supporting and helping the companions, if any were blocked or with any questions to ask was very welcome.\nLiberty Seguros, I participated in the project for Liberty insurer resolving incidents and creating new functionalities and modifications depending on the client\'s requirements.\nConfianza, I participated in the project of the insurance company Confianza where initially solving incidents, then I started to participate in new developments in the area of portfolio, reinsurance, and people management.\ntaca, I participated in the taca project which is a powerful, modern and robust insurance system that has many modules for managing it, using modern technologies and reusing components.\n', '2017-08-06'),
(46, 'Object Oriented Programming, \nJava is a computer programming language that is concurrent, class-based and object-oriented. The advantages of object oriented software development are shown below:\nModular development of code, which leads to easy maintenance and modification.\nReusability of code.\nImproved reliability and flexibility of code.\nIncreased understanding of code.\nObject-oriented programming contains many significant features, such as encapsulation, inheritance, polymorphism and abstraction. We analyze each feature separately in the following sections.\n\nEncapsulation\n\nEncapsulation provides objects with the ability to hide their internal characteristics and behavior. Each object provides a number of methods, which can be accessed by other objects and change its internal data. In Java, there are three access modifiers: public, private and protected. Each modifier imposes different access rights to other classes, either in the same or in external packages. Some of the advantages of using encapsulation are listed below:\nThe internal state of every objected is protected by hiding its attributes.\nIt increases usability and maintenance of code, because the behavior of an object can be independently changed or extended.\nIt improves modularity by preventing objects to interact with each other, in an undesired way.\nYou can refer to our tutorial here for more details and examples on encapsulation.\n\nPolymorphism\n\nPolymorphism is the ability of programming languages to present the same interface for differing underlying data types. A polymorphic type is a type whose operations can also be applied to values of some other type.\nInheritance\n\nInheritance provides an object with the ability to acquire the fields and methods of another class, called base class. Inheritance provides re-usability of code and can be used to add additional features to an existing class, without modifying it.\nAbstraction\n\nAbstraction is the process of separating ideas from specific instances and thus, develop classes in terms of their own functionality, instead of their implementation details. Java supports the creation and existence of abstract classes that expose interfaces, without including the actual implementation of all methods. The abstraction technique aims to separate the implementation details of a class from its behavior.\n\nDifferences between Abstraction and Encapsulation\n\nAbstraction and encapsulation are complementary concepts. On the one hand, abstraction focuses on the behavior of an object. On the other hand, encapsulation focuses on the implementation of an object?s behavior. Encapsulation is usually achieved by hiding information about the internal state of an object and thus, can be seen as a strategy used in order to provide abstraction.\n\n\nWhat is the difference between an Interface and an Abstract class ? Java provides and supports the creation both of abstract classes and interfaces. Both implementations share some common characteristics, but they differ in the following features:\nAll methods in an interface are implicitly abstract. On the other hand, an abstract class may contain both abstract and non-abstract methods.\nA class may implement a number of Interfaces, but can extend only one abstract class.\nIn order for a class to implement an interface, it must implement all its declared methods. However, a class may not implement all declared methods of an abstract class. Though, in this case, the sub-class must also be declared as abstract.\nAbstract classes can implement interfaces without even providing the implementation of interface methods.\nVariables declared in a Java interface is by default final. An abstract class may contain non-final variables.\nMembers of a Java interface are public by default. A member of an abstract class can either be private, protected or public.\nAn interface is absolutely abstract and cannot be instantiated. An abstract class also cannot be instantiated, but can be invoked if it contains a main method.', '2017-08-06'),
(47, 'When you are a project manager and you tell a programmer: if the other programmers can stay all night and dawn working, why can not you  do it too?, or when it\'s Monday and the project manager tells you: you had the whole weekend to work In x task.\n\nShould this person be recognized as a project manager?', '2017-08-07'),
(48, 'After winning some money on the lottery, Jimmie decided to go on the holiday of a lifetime and travel round the world. When he got to the airport, he realised his passport was still at home. So he had to go back and get it. When he arrived back home again, he noticed that his windows were still open. He was so forgetful sometimes! So he shut them, and went back to the airport. His first stop was New York. He didn\'t have a hotel reservation, but he had the phone numbers and addresses of some hotels in his pocket, so he could find a hotel when he arrived. Back at the airport, he showed his ticket and passport to the clerk. But the clerk said \'I\'m sorry, sir. It\'s the wrong day. Your flight is tomorrow.\' Jimmie just laughed.', '2017-08-07'),
(49, 'Sara Smith, a Pasadena resident, went shopping. She is 30, and has lived at 3037 N. Foothill Street since 1992. Sara has been married to John for seven years. They have two children; Bob is five years old and Na ncy is three. Sara owns a 1995 four-door blue Toyola. At 9 a.m., Sara got into her car and drove to Barget, a department store a mile away. Barget was having a holiday sale. Sara bought a four-slice toaster for $29.95 plus tax. The regular price was $39.95. She paid by check. On her way home, Sara stopped at MilkPlus to buy a gallon of nonfat milk. The milk was $3.50. Sara got 50 cents back in change. Sara arrived home at 10 a.m. John and the kids were still sleeping. She woke them up and then made a hot and nutritious breakfast for everyone.', '2017-08-07'),
(50, 'A 79-year-old man was slightly injured on Saturday while waiting in his brand new convertible in a drive-through lane at Burger Prince restaurant. Herman Sherman of Northville suffered a mild burn about 9:00 p.m. when a young female employee accidentally spilled a cup of coffee into his lap. Sherman said the coffee was hot but not scalding. He refused medical aid, saying the only problem was the stain on his slacks, but it would wash out. He was given a fresh refill. Before Sherman drove off, the restaurant manager, John Johnson, gave him two free gift certificates--one for an extra-large coffee and one for the restaurant\'s newest sandwich, the McRap. The employee, who was a new hire, was let go later that evening. She was quite upset. She said she would probably sue Burger Prince for letting her go. She said it was the man\'s fault for ordering something that she might be able to spill. ', '2017-08-07'),
(59, 'Six consecutive days of spring rain had created a raging river running by Nancy Brown\'s farm. As she tried to herd her cows to higher ground, she slipped and hit her head on a fallen tree trunk. The fall knocked her out for a moment or two. When she came to, Lizzie, one of her oldest and favorite cows, was licking her face. The water was rising. Nancy got up and began walking slowly with Lizzie. The water was now waist high. Nancy\'s pace got slower and slower. Finally, all she could do was to throw her arm around Lizzie\'s neck and try to hang on. About 20 minutes later, Lizzie managed to successfully pull herself and Nancy out of the raging water and onto a bit of high land, a small island now in the middle of acres of white water. Even though it was about noon, the sky was so dark and the rain and lightning so bad that it took rescuers another two hours to discover Nancy. A helicopter lowered a paramedic, who attached Nancy to a life-support hoist. They raised her into the helicopter and took her to the school gym, where the Red Cross had set up an emergency shelter. When the flood subsided two days later, Nancy immediately went back to the \"island.\" Lizzie was gone. She was one of 19 cows that Nancy lost. \"I owe my life to her,\" said Nancy sobbingly.', '2017-08-07'),
(65, 'Because I have worked with several technologies that the profile is requiring, on other occasions I have worked remotely and I have no problem, in my former work I  communicated remotely with my leaders who were in other places, I have learned from my ex-coworkers and I believe I can contribute knowledge to the this new development team.', '2017-08-24'),
(66, 'First of all, my goal was to create video games, at first I created some simple games, I did not have the contacts, so I did not follow this purpose, and I oriented to software for companies, I started to learn several technologies,I have learned many things about the industry of software, when you create applications you feel like a god, you can invent, you can create that you are imagining, I like it.', '2017-08-24'),
(67, 'The hardest project was for the ministry of education, I was working in this project from the beginning to the end. In the development stage, even in data migration, the project went through many stages, some colleagues left the company and I took their tasks to continue with the developments, in the moments of crisis I was there, I was continuing with the developments, I always gave my best effort. Regardless of being a software project it was a project for my country', '2017-08-24'),
