(70, 'When I go to the gym and on the bus someone speaks by cell phone aloud, \nand in their conversation talks about many issues that others do not care,\n that make me feel angry, because I?m listening music or reading something in the cellphone, \nthat is unpleasant to me because I try to focus.\n \nThe second cause that make me angry a little is when I arrive to the gym \nand the machine that I\'m going to use is occupied by a person who I do not like, \nor I do not tolerate it, sometimes I feel bad because someone do not want to lend the machine \nor sit in the machine spend time in his cell phone instead of exercising, that  is very annoying. \n \nAnd the third is when I finish my training and I go to take a shower and all the baths are occupied, \nand the people delay so much this make me angry, I do not like to be waiting so long.', '2017-09-09'),
(71, 'I remember a lot when I was studying the systems technologist course, we\nwere going to make a series of certifications, I was excited because in a\nmotivational conference they explained the importance of doing certifications,\nand how those certifications could help us in the workplace. I was very happy,\nand I studied hard to be well prepared, but on the day of the certification exam\nI had a fever, I had a headache, I could not concentrate, I had studied a lot\nbefore, but obviously I had to go over the subjects, my body wanted to rest, I\nfelt very exhausted, while I was studying I felt the discomfort, but I took\nstrength from where I did not have and presented the exam, I just wanted to\ndo it. The moment had arrived, I was able to reassure myself because I was\nnervous, and very anxious. I was able to answer all the questions, I was able to\ntake the exam, I could see the final result, after the exam, I feel lucky, It felt so\ngood, I felt super satisfied to have worked hard that day. This situation will\nhappen many times, every day will make sacrifices, rest or continue to meet\nyour goals.', '2017-09-10'),
(72, 'First I wanted to study topics that were going to serve my job growth, such as technologies and technological tools, I left English for later, I had read some topics but I did not follow.\n\nAt school I was taught grammar, I was very good at that subject, but that the education was not good, my teacher usually left written five sentences on the board and left us alone, there was no motivation at school.\n\nMany things in English did not understand, in movies, or in audios, people spoke very fast, also many texts did not understand them, many exercises did not understand either.\n\nWhenever I started learning the language I was discouraged, sometimes I did not want to continue to review the subjects. I did not know that the key was in repetition.\n\nMany times the work did not allow me time to study, when I tried to study, I thought about the work I had behind schedule.\n\n\n\nI would be not here in Colombia first, I would be working in the United States, since there was a company 3 years ago that contacted me, but they needed an intermediate level to be able to have a conversation.\n\nI would have had the opportunity to work remotely, this would imply the possibility to travel to other cities, to work and in the free time to know another city, and to make new friends.\n\nI would have had better incomes, since wages are very good when speaking English, this motivates me, since economic stability is very important.\n\nI would have studied other courses and i would have certified myself, since many courses are in English and I have lost a lot of opportunity for the language barrier.\n\nI would have visited other countries and knowing other cultures, and at least learning a third language.', '2017-09-10');
